import React from "react";
import logo from "../src/Images/logo.png";
import "./App.css";






function App() {
  return (
    <div className="navbar">
      <Link to="/">
        <a className="active" href="#">
          Home
        </a>
      </Link>
      <a href="#">Search</a>
      <a href="#">Contact</a>
      <a href="#">Login</a>
    </div>
  );

}

export default App;
